import React from 'react';

 const Keybord = ({alphabet, action}) => {
  return(
      <div>
          {
            alphabet.map(
                (letter, index) => {
                    return <button key={index}
                    
                    >{letter}</button>
                }
            )
          }
      </div>
  )
}

export default Keybord;
